import '../C_dashboard/style_dashboard.css';
import AU1841139 from "../C_dashboard/user_profiles/AU1841139.jpeg"
import icon_profile_school from "../C_dashboard/icons/icon_profile_school.png"
import icon_profile_student from "../C_dashboard/icons/icon_profile_student.png"
import icon_profile_degree from "../C_dashboard/icons/icon_profile_degree.png"
import React from 'react';



function profile(props) {
  
  return (    
    <div class="profile">      
         <img src={AU1841131} class="user_profile" alt="icon"/>
         <div class="user_detail_type">
           
           <img src={icon_profile_student} class="profile_icon" alt="icon" />
           {props.userprofile_about}

         </div>

         <div class="user_detail_key">
            <span>{props.user_name}</span>
            <span>{props.user_rollno}</span>
         </div>         
         <div class="user_detail_type">           
           <img src={icon_profile_school} class="profile_icon" alt="icon" />
           {props.user_school}
         </div>
         <div class="user_detail_type">
           <img src={icon_profile_degree} class="profile_icon" alt="icon" />
           {props.user_degree}
         </div>
    </div>  
  );
}

export default profile;
